JSON Schema can be used to require that a given JSON document (an instance) satisfies a certain number of criteria. JSON Schema validation asserts constraints on the structure of instance data. An instance location that satisfies all asserted constraints is then annotated with any keywords that contain non-assertion information, such as descriptive metadata and usage hints. If all locations within the instance satisfy all asserted constraints, then the instance is said to be valid against the schema. Each schema object is independently evaluated against each instance location to which it applies. This greatly simplifies the implementation requirements for validators by ensuring that they do not need to maintain state across the document-wide validation process. More about JSON schemas can be found here and here . Let's see an example JSON schema definition: { "$schema": "http://json-schema.org/draft-07/schema#", "description": "Alumni", "type": "object", "properties": { "emailAddress": { "type": "string", "format": "email" }, "alumniOf": { "type": "string" } }, "required": ["emailAddress", "alumniOf"], "additionalProperties": false
} In our context, these schemas are stored on-chain as a blob, which means they have a Blob Id as id and a DID as author: { "id": "blob:dock:1DFdyZkZnALDdCAp7crTRiaCq6KViprTM6kHUQCD8X6VqGPW", "author": "did:dock:5CEdyZkZnALDdCAp7crTRiaCq6KViprTM6kHUQCD8X6VqGPW", "schema": { "$schema": "http://json-schema.org/draft-07/schema#", "description": "Alumni", "type": "object", "properties": { "emailAddress": { "type": "string", "format": "email" }, "alumniOf": { "type": "string" } }, "required": ["emailAddress", "alumniOf"], "additionalProperties": false }
} Had we referenced this JSON schema from within a Verifiable Credential, validation would fail if the credentialSubject doesn't contain an emailAddress field, or it isn't a string formatted as an email; or if it doesn't contain a property alumniOf with type string. It'd also fail if a subject contains other properties not listed here (except for the id property which is popped out before validation).

